// Define 2D array to store uint16_t elements
uint16_t **doodle_map_2d;
uint16_t **background_map_2d;

void convert_to_2d(uint16_t **matrix, const uint8_t *arr, int row, int col) {
    int i, j, k = 0;
    for (i = 0; i < row; i++) {
        for (j = 0; j < col; j++) {
            // Merge two 8-bit values into one 16-bit value with adjusted byte order
            uint16_t merged_value = (uint16_t)arr[k + 1] << 8 | arr[k];
            matrix[i][j] = merged_value; // Store merged value in the 2D array
            k += 2; // Move to the next pair of values in the 1D array
        }
    }
}

